import React, { useState, useEffect } from "react";
import { fetchUsers, createUser, deleteUser } from "../services/api"; // Importer API-funksjonene

function ManageUsers() {
  const [users, setUsers] = useState([]);
  const [newUser, setNewUser] = useState({
    name: "",
    username: "",
    email: "",
    password: "",
    role: "user",
  });

  // Hent alle brukere
  useEffect(() => {
    fetchUsers()
      .then((data) => setUsers(data))
      .catch((error) => console.error("Feil ved henting av brukere:", error));
  }, []);

  // Registrer ny bruker
  const addUser = (e) => {
    e.preventDefault();
    createUser(newUser)
      .then((data) => {
        setUsers([...users, data]);
        setNewUser({
          name: "",
          username: "",
          email: "",
          password: "",
          role: "user",
        });
      })
      .catch((error) => console.error("Feil ved oppretting av bruker:", error));
  };

  // Slett bruker
  const removeUser = (id) => {
    deleteUser(id)
      .then(() => setUsers(users.filter((user) => user._id !== id)))
      .catch((error) => console.error("Feil ved sletting av bruker:", error));
  };

  return (
    <div className="p-8 bg-gradient-to-r from-[#90E0EF] to-[#CAF0F8] min-h-screen">
      <nav className="flex justify-between p-4 bg-[#023E8A] text-white">
        <a href="/dashboard" className="text-lg font-bold">
          Hjem
        </a>
        <a href="/login" className="text-lg font-bold">
          Logg ut
        </a>
      </nav>

      <h1 className="flex items-center justify-center mb-4 text-3xl font-bold text-[#023E8A]">
        Brukeradministrasjon
      </h1>

      <form
        onSubmit={addUser}
        className="max-w-sm p-10 mb-8 bg-white rounded-lg shadow-lg "
      >
        <h2 className="text-center mb-4 text-xl text-[#023E8A]">
          Registrer ny bruker
        </h2>

        <input
          type="text"
          placeholder="Navn"
          value={newUser.name}
          onChange={(e) => setNewUser({ ...newUser, name: e.target.value })}
          className="w-full p-3 mb-4 border-2 border-[#023E8A] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0077B6]"
          required
        />

        <input
          type="text"
          placeholder="Brukernavn"
          value={newUser.username}
          onChange={(e) => setNewUser({ ...newUser, username: e.target.value })}
          className="w-full p-3 mb-4 border-2 border-[#023E8A] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0077B6]"
          required
        />

        <input
          type="email"
          placeholder="E-post"
          value={newUser.email}
          onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
          className="w-full p-3 mb-4 border-2 border-[#023E8A] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0077B6]"
          required
        />

        <input
          type="password"
          placeholder="Passord"
          value={newUser.password}
          onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
          className="w-full p-3 mb-4 border-2 border-[#023E8A] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0077B6]"
          required
        />

        <select
          value={newUser.role}
          onChange={(e) => setNewUser({ ...newUser, role: e.target.value })}
          className="w-full p-3 mb-4 border-2 border-[#023E8A] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0077B6]"
        >
          <option value="user">User</option>
          <option value="admin">Admin</option>
        </select>

        <div className="flex justify-center w-full">
          <button
            type="submit"
            className="mt-16 p-3 text-white bg-[#0077B6] rounded-lg hover:bg-[#023E8A] focus:ring-4 focus:ring-[#90E0EF]"
          >
            Registrer bruker
          </button>
        </div>
      </form>

      <h2 className="mb-4 text-xl text-[#023E8A]">Eksisterende brukere</h2>
      <ul className="space-y-4">
        {users.map((user) => (
          <li key={user._id} className="p-4 bg-white rounded-lg shadow">
            <p>
              <strong>Navn:</strong> {user.name}
            </p>
            <p>
              <strong>Brukernavn:</strong> {user.username}
            </p>
            <p>
              <strong>E-post:</strong> {user.email}
            </p>
            <p>
              <strong>Passord:</strong> {user.password}
            </p>
            <p>
              <strong>Rolle:</strong> {user.role}
            </p>

            <button
              onClick={() => removeUser(user._id)}
              className="p-2 mt-2 text-white bg-red-500 rounded-lg hover:bg-red-600 focus:ring-4 focus:ring-[#CAF0F8]"
            >
              Slett
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ManageUsers;
